import React from "React";
import PropTypes from "prop-types";
import Link from "next/link";

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>메인</a>
        </Link>
        <Link href="/about/profile">
          <a>프로필</a>
        </Link>
        <Link href="/signup">
          <a>가입하기</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
